(218, 'plan_purchased', 'Plan Purchased', 'Plan Purchased successfully', 'Congratulation, you successfully&nbsp;Purchased {{plan}},&nbsp; {{amount}} {{currency}}&nbsp; And your current balance is {{post_balance}}&nbsp;<span style=\"color: rgb(33, 37, 41);\">&nbsp;{{currency}}</span>. Transaction number {{trx}}', 'Congratulation, you successfully Purchased {{plan}},  {{amount}} {{currency}}  And your current balance is {{post_balance}}  {{currency}}. Transaction number {{trx}}', ' {\r\n                    \"plan\":\"Plan name\",\r\n                    \"amount\":\"Plan price\",\r\n                \"post_balance\":\" After Balance\",\r\n                \"currency\":\"Site Currency\",\r\n                \"trx\":\"Transaction number\"\r\n            }', 1, 1, '2019-09-14 19:14:22', '2019-11-10 09:07:12'),
(220, 'referral_commission', 'Referral Commission', 'Tree Commission', 'Congratulation, you get Tree Commission from user {{username}} ,&nbsp; &nbsp;{{amount}} {{currency}}&nbsp; And your current balance is {{post_balance}}&nbsp;&nbsp;{{currency}}. Transaction number {{trx}}', 'Congratulation, you get Referral Commission from user {{username}} ,   {{amount}} {{currency}}  And your current balance is {{post_balance}}  {{currency}}. Transaction number {{trx}}', ' {\r\n                    \"username\":\"commission From user\",\r\n                    \"amount\":\"Plan price\",\r\n                \"post_balance\":\" After Balance\",\r\n                \"currency\":\"Site Currency\",\r\n                \"trx\":\"Transaction number\"\r\n            }', 1, 1, '2019-09-14 19:14:22', '2023-02-14 15:00:53'),
(221, 'BAL_SEND', 'Balance Send', 'Balance Transfer Successfully', '<div>Balance transferred successfully complete. You send  {{amount}} {{currency}}  to  {{username}}  And charge to transfer  {{charge}}  {{currency}} .</div><div><br></div><div>Transaction number {{trx}} .<br></div><div><br></div><div> Your Current Balance is {{balance_now}}  {{currency}}.</div>', 'Balance transferred successfully complete. You send {{amount}} {{currency}} to {{username}} And charge to transfer {{charge}} {{currency}} .\r\n\r\nTransaction number {{trx}} .\r\n\r\nYour Current Balance is {{balance_now}} {{currency}}.', '{\"amount\":\"Send Amount\", \"username\":\"Receiver Username\",\"charge\":\"Transfer charge\" ,\"balance_now\":\" After Balance\", \"currency\":\"currency\",\"trx\":\"Transaction number\"}', 1, 1, '2019-09-14 19:14:22', '2023-08-23 13:20:32'),
(222, 'BAL_RECEIVE', 'Balance Received', 'Balance Received Successfully', 'Balance received successfully. You got {{amount}} \r\n{{currency}} from&nbsp; {{username}}  And charge to transfer  {{charge}}  \r\n{{currency}} .<div><div><br></div><div>Transaction number {{trx}} .<br></div><div><br></div><div> Your Current Balance is {{balance_now}}  {{currency}}.</div></div>', 'Balance received successfully. You got {{amount}} {{currency}} from  {{username}} And charge to transfer {{charge}} {{currency}} .\r\n\r\nTransaction number {{trx}} .\r\n\r\nYour Current Balance is {{balance_now}} {{currency}}.', '{\"amount\":\"Received Amount\", \"username\":\"Sender Username\",\"charge\":\"Transfer charge\" ,\"balance_now\":\" After Balance\", \"currency\":\"currency\",\"trx\":\"Transaction number\"}', 1, 1, '2019-09-14 19:14:22', '2023-08-23 13:20:57'),
(223, 'SURVEY_COMPLETED', 'Survey  - User completed', 'You have completed Survey Successfully', '<div>You have successfully completed a survey named {{survey_name}} .</div><div><b style=\"font-size: 1rem;\"><br></b></div><div><span style=\"font-size: 1rem;\">You got</span><b style=\"font-size: 1rem;\"> {{amount}} {{currency}}</b><span style=\"color: rgb(33, 37, 41); font-size: 1rem;\">&nbsp;&nbsp;</span>as reward<span style=\"color: rgb(33, 37, 41); font-size: 1rem;\">.</span></div><div><font size=\"5\"><b><br></b></font></div><div><font size=\"5\">Your current Balance is <b>{{post_balance}} {{currency}}</b></font></div><div><br></div><div><br><br><br><br></div>', 'You have Successfully completed a survey named {{survey_name}}. You got {{amount}} {{currency}} as reward.', '{\"survey_name\":\"Survey Name\",\"amount\":\"Reward Amount\",\"post_balance\":\"Current Balance\",\"currency\":\"Site Currency\"}', 0, 1, NULL, '2023-02-14 14:39:02'),
(224, 'TRANSFER_CODE', 'Transfer Confirmation OTP', 'Transfer Confirmation OTP', '<div>We have received a request to transfer amount from your account on <b>{{time}} .<br></b></div><div>Requested From IP: <b>{{ip}}</b> using <b>{{browser}}</b> on <b>{{operating_system}} </b>.</div><div><br></div><br><div><div><div>Your amount transfer code is:&nbsp;&nbsp; <font size=\"6\"><b>{{code}}</b></font></div><div><br></div></div></div><div><br></div><div><font size=\"4\" color=\"#CC0000\">If it is not you, please ignore this message and change your password immediately.</font><br></div><br>', 'Your account recovery code is: {{code}}', ' {\"code\":\"Transfer Confirmation OTP\",\"ip\":\"IP of User\",\"browser\":\"Browser of User\",\"operating_system\":\"Operating System of User\",\"time\":\"Request Time\"}', 1, 1, '2019-09-24 23:04:05', '2023-08-23 13:22:29');
