(97, 'banner.content', '{\"has_image\":\"1\",\"heading\":\"Avante is Decentralized with EMS Ecosystem!\",\"subheading\":\"We are thrilled to announce the official launch of Stakeavnate.org is coming soon\\u2013 your premier destination for innovative solutions in the world of stakeholder engagement. At StakeAvnate, we believe in fostering meaningful connections and driving positive change.\",\"description\":\"\\u201cLet your Avantes work for you\\u201d\",\"left_button\":\"Sign In\",\"left_button_link\":\"login\",\"right_button\":\"Sign Up\",\"right_button_link\":\"register\",\"background_image\":\"64aee4e3e050d1689183459.png\"}', '2022-02-23 00:26:29', '2024-01-05 23:00:42'),
