(109, 'faq.element', '{\"question\":\"How to making a withdrawal?\",\"answer\":\"You can withdraw your amount any time by following below simple steps.\\r\\n<br \\/>1) Login to your dashboard\\r\\n<br \\/> 2) Click on withdraw now menu on left side bar.\\r\\n<br \\/> 3) Click on Avante\\r\\n<br \\/> 4) Follow the instructions.\\r\\n<br \\/> 5) Admin will approve your withdrawal and you will get amount.\"}', '2022-02-23 05:56:40', '2023-07-10 17:28:52'),
(110, 'faq.element', '{\"question\":\"I have not received my withdrawal\",\"answer\":\"Every user is facilitated with support system available in his\\/her account.Send screen shot of your withdrawal process along with generating support ticket.Admin will solve your issue.in case of urgent processing contact us on call or whats app.\"}', '2022-02-23 05:57:02', '2023-02-14 13:14:21'),
(113, 'faq.element', '{\"question\":\"What is a Stakeavante Staking Plan?\",\"answer\":\"Staking on avante market place has below plans.\\r\\nStaking plan needs at least 100AXT and has seven level.\\r\\n<br \\/>1) Level one will unlock on initial purchase of 100AXT.\\r\\n<br \\/>2) Level two will unlock on  purchase of total 300AXT.\\r\\n<br \\/>3) Level three will unlock on  purchase of total  500AXT.\\r\\n<br \\/>4) Level four will unlock on  purchase of total  600AXT.\\r\\n<br \\/>5) Level five will unlock on  purchase of total 700AXT.\\r\\n<br \\/>6) Level six will unlock on  purchase of total  800AXT.\\r\\n<br \\/>7) Level seven will unlock on  purchase of total  1000AXT.\"}', '2022-02-23 05:57:33', '2023-07-10 17:46:59'),
