(125, 'policy_pages.element', '{\"title\":\"Privacy policy\",\"details\":\"<p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:12pt;margin-bottom:12pt;\\\"><span style=\\\"font-size:12pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\">Last updated: February 02, 2023<\\/span><\\/p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:12pt;margin-bottom:12pt;\\\"><span style=\\\"font-size:12pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\">This Privacy Policy describes Our policies and procedures on the collection, use and disclosure of Your information when You use the Service and tells You about Your privacy rights and how the law protects You.<\\/span><\\/p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:12pt;margin-bottom:12pt;\\\"><span style=\\\"font-size:12pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\">We use Your Personal data to provide and improve the Service. By using the Service, You agree to the collection and use of information in accordance with this Privacy Policy.<\\/span><\\/p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:12pt;margin-bottom:12pt;\\\"><span style=\\\"font-size:12pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\">Interpretation and Definitions<\\/span><\\/p><h2 dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:18pt;margin-bottom:4pt;\\\"><span style=\\\"font-size:17pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\">Interpretation<\\/span><\\/h2><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:12pt;margin-bottom:12pt;\\\"><span style=\\\"font-size:12pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\">The words of which the initial letter is capitalized have meanings defined under the following conditions. The following definitions shall have the same meaning regardless of whether they appear in singular or in plural.<\\/span><\\/p><h2 dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:18pt;margin-bottom:4pt;\\\"><span style=\\\"font-size:17pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\">Definitions<\\/span><\\/h2><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:12pt;margin-bottom:12pt;\\\"><span style=\\\"font-size:12pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\">For the purposes of this Privacy Policy:<\\/span><\\/p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:12pt;margin-bottom:12pt;\\\"><span style=\\\"font-size:12pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\">Account<\\/span><span style=\\\"font-size:12pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\"> means a unique account created for You to access our Service or parts of our Service.<\\/span><\\/p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:12pt;margin-bottom:12pt;\\\"><span style=\\\"font-size:12pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\">Affiliate<\\/span><span style=\\\"font-size:12pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\"> means an entity that controls, is controlled by or is under common control with a party, where \\\"control\\\" means ownership of 50% or more of the shares, equity interest or other securities entitled to vote for election of directors or other managing authority.<\\/span><\\/p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:12pt;margin-bottom:12pt;\\\"><span style=\\\"font-size:12pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\">Company<\\/span><span style=\\\"font-size:12pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\"> (referred to as either \\\"the Company \'\', \\\"We\\\", \\\"Us\\\" or \\\"Our\\\" in this Agreement) refers to businesshelptogether, Pakistan.<\\/span><\\/p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:12pt;margin-bottom:12pt;\\\"><span style=\\\"font-size:12pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\">Cookies<\\/span><span style=\\\"font-size:12pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\"> are small files that are placed on Your computer, mobile device or any other device by a website, containing the details of Your browsing history on that website among its many uses.<\\/span><\\/p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:12pt;margin-bottom:12pt;\\\"><span style=\\\"font-size:12pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\">Country<\\/span><span style=\\\"font-size:12pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\"> refers to: Pakistan<\\/span><\\/p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:12pt;margin-bottom:12pt;\\\"><span style=\\\"font-size:12pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\">Device<\\/span><span style=\\\"font-size:12pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\"> means any device that can access the Service such as a computer, a cell phone or a digital tablet.<\\/span><\\/p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:12pt;margin-bottom:12pt;\\\"><span style=\\\"font-size:12pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\">Personal Data<\\/span><span style=\\\"font-size:12pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\"> is any information that relates to an identified or identifiable individual.<\\/span><\\/p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:12pt;margin-bottom:12pt;\\\"><span style=\\\"font-size:12pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\">Service<\\/span><span style=\\\"font-size:12pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\"> refers to the Website.<\\/span><\\/p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:12pt;margin-bottom:12pt;\\\"><span style=\\\"font-size:12pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\">Service Provider<\\/span><span style=\\\"font-size:12pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\"> means any natural or legal person who processes the data on behalf of the Company. It refers to third-party companies or individuals employed by the Company to facilitate the Service, to provide the Service on behalf of the Company, to perform services related to the Service or to assist the Company in analyzing how the Service is used.<\\/span><\\/p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:12pt;margin-bottom:12pt;\\\"><span style=\\\"font-size:12pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\">Usage Data<\\/span><span style=\\\"font-size:12pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\"> refers to data collected automatically, either generated by the use of the Service or from the Service infrastructure itself (for example, the duration of a page visit).<\\/span><\\/p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:12pt;margin-bottom:12pt;\\\"><span style=\\\"font-size:12pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\">Website<\\/span><span style=\\\"font-size:12pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\"> refers to businesshelptogether, accessible from<\\/span><a href=\\\"https:\\/\\/businesshelptogether.com\\/\\\" style=\\\"text-decoration:none;\\\"><span style=\\\"font-size:12pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\"> <\\/span><span style=\\\"font-size:12pt;font-family:Roboto, sans-serif;color:#1155cc;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\">https:\\/\\/businesshelptogether.com\\/<\\/span><\\/a><\\/p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:12pt;margin-bottom:12pt;\\\"><span style=\\\"font-size:12pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\">You<\\/span><span style=\\\"font-size:12pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\"> means the individual accessing or using the Service, or the company, or other legal entity on behalf of which such individual is accessing or using the Service, as applicable.<\\/span><\\/p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:12pt;margin-bottom:12pt;\\\"><span style=\\\"font-size:12pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\">Collecting and Using Your Personal Data<\\/span><\\/p><h2 dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:18pt;margin-bottom:4pt;\\\"><span style=\\\"font-size:17pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\">Types of Data Collected<\\/span><\\/h2><h3 dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:14pt;margin-bottom:4pt;\\\"><span style=\\\"font-size:13pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\">Personal Data<\\/span><\\/h3><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:12pt;margin-bottom:12pt;\\\"><span style=\\\"font-size:12pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\">While using Our Service, We may ask You to provide Us with certain personally identifiable information that can be used to contact or identify You. Personally identifiable information may include, but is not limited to:<\\/span><\\/p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:12pt;margin-bottom:12pt;\\\"><span style=\\\"font-size:12pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\">Email address<\\/span><\\/p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:12pt;margin-bottom:12pt;\\\"><span style=\\\"font-size:12pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\">First name and last name<\\/span><\\/p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:12pt;margin-bottom:12pt;\\\"><span style=\\\"font-size:12pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\">Phone number<\\/span><\\/p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:12pt;margin-bottom:12pt;\\\"><span style=\\\"font-size:12pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\">Usage Data<\\/span><\\/p><h3 dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:14pt;margin-bottom:4pt;\\\"><span style=\\\"font-size:13pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\">Usage Data<\\/span><\\/h3><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:12pt;margin-bottom:12pt;\\\"><span style=\\\"font-size:12pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;