\\"ltr\\\" style=\\\"line-height:1.38;margin-top:14pt;margin-bottom:4pt;\\\"><span style=\\\"font-size:13pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\">Tracking Technologies and Cookies<\\/span><\\/h3><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:12pt;margin-bottom:12pt;\\\"><span style=\\\"font-size:12pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\">We use Cookies and similar tracking technologies to track the activity on Our Service and store certain information. Tracking technologies used are beacons, tags, and scripts to collect and track information and to improve and analyze Our Service. The technologies We use may include:<\\/span><\\/p><p dir=\\\"ltr\\\" style=\\\"line-height:1.38;margin-top:12pt;margin-bottom:12pt;\\\"><span style=\\\"font-size:12pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\">\\u00b7<\\/span><span style=\\\"font-size:6.999999999999999pt;font-family:\'Times New Roman\';color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\"> \\u00a0 \\u00a0 \\u00a0 \\u00a0 <\\/span><span style=\\\"font-size:12pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\\\">Cookies or Browser Cookies.<\\/span><span style=\\\"font-size:12pt;font-family:Roboto, sans-serif;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-dec